import React from 'react';
import './Confirmation.scss';
import { IoIosCheckboxOutline } from 'react-icons/io';
import Titlebar from '../../components/TitleBar/TitleBar';

const Confirmation = (props) => {
    return (
        <div class="ConfirmContainer">
            <IoIosCheckboxOutline className="ConfirmIcon" size={70}/>
            <Titlebar title="Informacje o zamówieniu"/>
            <h3>ZAMÓWIENIE NR {props.orderno} ZOSTAŁO ZŁOŻONE</h3>
            <p>Aby sfinalizować zamówienie opłać je dokonując przelewu bankowego na konto: <br/>
            </p>
            </div>
    )
}

export default Confirmation;
